-- ----------------------------
-- Table structure for bk_operate_log
-- ----------------------------

CREATE TABLE `bk_operate_log` (
`id`  bigint(20) NOT NULL AUTO_INCREMENT ,
`createtime`  datetime NULL DEFAULT NULL ,
`user_id`  int(11) NULL DEFAULT NULL ,
