-- ----------------------------
-- Table structure for evl_questionnaires
-- ----------------------------

CREATE TABLE `evl_questionnaires` (
`questionnaires_id`  int(11) NOT NULL AUTO_INCREMENT COMMENT '方案id' ,
`title`  varchar(128) CHARACTER SET utf8 COLLATE utf8_general_ci NULL DEFAULT NULL COMMENT '标题' ,
`totle_score`  double NULL DEFAULT NULL COMMENT '问卷总分' ,
`directions`  text CHARACTER SET utf8 COLLATE utf8_general_ci NULL COMMENT '说明' ,
`type`  tinyint(4) NULL DEFAULT NULL COMMENT '评教类型{1：学生评教 2：家长评教 3：教师自评 4：民主互评}' ,
`student_type`  tinyint(4) NULL DEFAULT NULL COMMENT '评教人员类型{1：全体学生/家长 2：按年级选择 3：按班级选择}' ,
`subject_ids`  varchar(512) CHARACTER SET utf8 COLLATE utf8_general_ci NULL DEFAULT NULL COMMENT '评价学科{逗号分隔}' ,
`operation_type`  tinyint(4) NULL DEFAULT NULL COMMENT '考核时段{1：学期  2：学年}' ,
`xueqi`  tinyint(4) NULL DEFAULT NULL COMMENT '学期类型{{上学期：1，下学期：2}}' ,
`indicator_type`  tinyint(4) NULL DEFAULT NULL COMMENT '评价方式{1：整体评教 2：对各一级指标进行评价 3：对各二级指标进行评价}' ,
`status`  int(11) NULL DEFAULT NULL COMMENT '评教状态' ,
`enable`  int(1) NULL DEFAULT NULL COMMENT '1：可用 2：不可用' ,
`school_year`  int(11) NULL DEFAULT NULL COMMENT '学年' ,
`iscollect`  tinyint(4) NULL DEFAULT NULL COMMENT '是否收集建议{1:收集 0:不收集}' ,
`org_id`  int(11) NULL DEFAULT NULL ,
`crt_id`  int(11) NULL DEFAULT NULL ,
`crt_dttm`  datetime NULL DEFAULT NULL ,
`last_id`  int(11) NULL DEFAULT NULL ,
`last_dttm`  datetime NULL DEFAULT NULL ,
`back1`  varchar(32) CHARACTER SET utf8 COLLATE utf8_general_ci NULL DEFAULT NULL ,
`back2`  int(32) NULL DEFAULT NULL ,
`phase_id`  int(11) NULL DEFAULT NULL COMMENT '学段' ,
PRIMARY KEY (`questionnaires_id`),
INDEX `org_id` (`org_id`) USING BTREE 
)
ENGINE=InnoDB
DEFAULT CHARACTER SET=utf8 COLLATE=utf8_general_ci
COMMENT='考核评教相关设置表'
AUTO_INCREMENT=1

;


