-- ----------------------------
-- Table structure for jy_notice
-- ----------------------------

CREATE TABLE `jy_notice` (
`id`  bigint(20) NOT NULL AUTO_INCREMENT ,
`sender_id`  int(11) NOT NULL COMMENT '通知发送者id' ,
`receiver_id`  varchar(32) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL COMMENT '通知接受者id' ,
`send_date`  timestamp NOT NULL DEFAULT CURRENT_TIMESTAMP COMMENT '发送时间' ,
`title`  varchar(200) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL COMMENT '标题' ,
`detail`  text CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL COMMENT '通知详情' ,
`sender_state`  tinyint(4) NOT NULL DEFAULT 0 COMMENT '发送者状态,1：已删除，0：未删除' ,
`sender_state_change_date`  timestamp NOT NULL DEFAULT '0000-00-00 00:00:00' COMMENT '发送者更改状态时间' ,
`receiver_state`  tinyint(4) NOT NULL DEFAULT 0 COMMENT '接受者状态，2：已阅读，1：已删除，0：未阅读' ,
`receiver_state_change_date`  timestamp NOT NULL DEFAULT '0000-00-00 00:00:00' COMMENT '接受通知者更改状态时间' ,
`business_type`  int(2) NOT NULL COMMENT '业务类型' ,
`detail_type`  int(2) NOT NULL COMMENT '详情类型：0、弹出框；1、新页面打开；2、url跳转' ,
`parent_id`  bigint(20) NULL DEFAULT NULL ,
`parent_ids`  varchar(200) CHARACTER SET utf8 COLLATE utf8_general_ci NULL DEFAULT NULL ,
`crt_id`  int(11) NULL DEFAULT NULL COMMENT '创建人' ,
`crt_dttm`  datetime NULL DEFAULT NULL COMMENT '创建时间' ,
`lastup_id`  int(11) NULL DEFAULT NULL COMMENT '最后更新用户' ,
`lastup_dttm`  datetime NULL DEFAULT NULL COMMENT '最后更新时间' ,
`sender_user_name`  varchar(32) CHARACTER SET utf8 COLLATE utf8_general_ci NULL DEFAULT NULL ,
`receiver_user_name`  varchar(32) CHARACTER SET utf8 COLLATE utf8_general_ci NULL DEFAULT NULL ,
PRIMARY KEY (`id`),
INDEX `serder_id_index` (`sender_id`) USING BTREE ,
INDEX `receiver_id_index` (`receiver_id`) USING BTREE 
)
ENGINE=InnoDB
DEFAULT CHARACTER SET=utf8 COLLATE=utf8_general_ci
COMMENT='消息表'
AUTO_INCREMENT=1

;


-- ----------------------------
