-- ----------------------------
-- Table structure for sys_dic
-- ----------------------------

CREATE TABLE `sys_dic` (
`dic_id`  int(11) NOT NULL DEFAULT 0 ,
`dic_name`  varchar(64) CHARACTER SET utf8 COLLATE utf8_general_ci NULL DEFAULT NULL ,
`parent_id`  smallint(5) UNSIGNED NULL DEFAULT NULL ,
`dic_level`  tinyint(3) UNSIGNED NULL DEFAULT NULL ,
`dic_orderby`  int(11) NULL DEFAULT NULL ,
`dic_status`  varchar(32) CHARACTER SET utf8 COLLATE utf8_general_ci NULL DEFAULT NULL ,
`operator`  varchar(32) CHARACTER SET utf8 COLLATE utf8_general_ci NULL DEFAULT NULL ,
`cascade_dic_ids`  varchar(64) CHARACTER SET utf8 COLLATE utf8_general_ci NULL DEFAULT NULL ,
`child_count`  smallint(5) UNSIGNED NULL DEFAULT NULL ,
`standard_code`  varchar(8) CHARACTER SET utf8 COLLATE utf8_general_ci NULL DEFAULT NULL ,
`type`  varchar(8) CHARACTER SET utf8 COLLATE utf8_general_ci NULL DEFAULT NULL COMMENT '作用范围：系统，区域，机构' ,
`org_id`  int(11) NULL DEFAULT NULL COMMENT '机构id' ,
`area_id`  int(11) NULL DEFAULT NULL COMMENT '区域id' ,
`enable`  tinyint(2) NULL DEFAULT 1 ,
PRIMARY KEY (`dic_id`)
)
ENGINE=InnoDB
DEFAULT CHARACTER SET=utf8 COLLATE=utf8_general_ci
COMMENT='元数据描述表'
AUTO_INCREMENT=1
;


-- ----------------------------
-- Table structure for sys_login
-- ----------------------------

CREATE TABLE `sys_login` (
`id`  int(11) NOT NULL AUTO_INCREMENT ,
`loginname`  varchar(32) CHARACTER SET utf8 COLLATE utf8_general_ci NULL DEFAULT NULL ,
`password`  varchar(32) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL DEFAULT '' ,
`cellphone`  varchar(11) CHARACTER SET utf8 COLLATE utf8_general_ci NULL DEFAULT '' ,
`mail`  varchar(128) CHARACTER SET utf8 COLLATE utf8_general_ci NULL DEFAULT '' ,
`enable`  tinyint(4) NULL DEFAULT 0 ,
`deleted`  tinyint(1) NULL DEFAULT NULL ,
`salt`  char(8) CHARACTER SET utf8 COLLATE utf8_general_ci NULL DEFAULT '' ,
`is_admin`  tinyint(1) NULL DEFAULT 0 ,
`logincode`  varchar(64) CHARACTER SET utf8 COLLATE utf8_general_ci NULL DEFAULT '' COMMENT '第三方登陆代码' ,
PRIMARY KEY (`id`),
UNIQUE INDEX `loginname` (`loginname`) USING BTREE 
)
ENGINE=InnoDB
DEFAULT CHARACTER SET=utf8 COLLATE=utf8_general_ci
AUTO_INCREMENT=1

;


-- ----------------------------
-- Table structure for sys_login_log
-- ----------------------------

CREATE TABLE `sys_login_log` (
`id`  bigint(20) NOT NULL AUTO_INCREMENT ,
`user_id`  int(11) NULL DEFAULT NULL ,
`space_id`  int(11) NULL DEFAULT NULL ,
`ip`  varchar(32) CHARACTER SET utf8 COLLATE utf8_general_ci NULL DEFAULT NULL ,
`grade_id`  int(11) NULL DEFAULT NULL ,
`subject_id`  int(11) NULL DEFAULT NULL ,
`sys_role_id`  int(11) NULL DEFAULT NULL COMMENT '系统角色id' ,
`login_time`  timestamp NOT NULL DEFAULT CURRENT_TIMESTAMP ON UPDATE CURRENT_TIMESTAMP COMMENT '登录时间或切换角色时间' ,
`type`  tinyint(2) NULL DEFAULT NULL COMMENT '登录类型。 0 ：正常登录 ， 1  切换身份' ,
PRIMARY KEY (`id`)
)
ENGINE=InnoDB
DEFAULT CHARACTER SET=utf8 COLLATE=utf8_general_ci
COMMENT='用户登录日志'
AUTO_INCREMENT=1

;

-- ----------------------------
-- Table structure for sys_meta_relationship
-- ----------------------------

CREATE TABLE `sys_meta_relationship` (
`id`  int(11) NOT NULL DEFAULT 0 ,
`name`  varchar(20) CHARACTER SET utf8 COLLATE utf8_general_ci NULL DEFAULT NULL COMMENT '学制名称' ,
`ids`  varchar(10000) CHARACTER SET utf8 COLLATE utf8_general_ci NULL DEFAULT NULL ,
`type`  tinyint(4) NULL DEFAULT NULL COMMENT '类型， 0 -- 学制(id)<--->年级(ids)\r\n                        1 -- 学段(mid)<--->学科(ids)' ,
`eid`  int(11) NULL DEFAULT NULL COMMENT '基础元素id' ,
`sort`  int(11) NULL DEFAULT 0 COMMENT '排序等相关信息' ,
`descs`  varchar(10000) CHARACTER SET utf8 COLLATE utf8_general_ci NULL DEFAULT NULL ,
`scope`  varchar(8) CHARACTER SET utf8 COLLATE utf8_general_ci NULL DEFAULT NULL COMMENT '作用范围：系统，区域，机构' ,
`org_id`  int(11) NULL DEFAULT NULL COMMENT '机构id' ,
`area_id`  int(11) NULL DEFAULT NULL COMMENT '区域id' ,
`enable`  tinyint(2) NULL DEFAULT 1 ,
`exclude_ids`  text CHARACTER SET utf8 COLLATE utf8_general_ci NULL ,
`exclude_names`  text CHARACTER SET utf8 COLLATE utf8_general_ci NULL ,
PRIMARY KEY (`id`)
)
ENGINE=InnoDB
DEFAULT CHARACTER SET=utf8 COLLATE=utf8_general_ci
COMMENT='基础元数据关系表'
AUTO_INCREMENT=1
;


-- ----------------------------
-- Table structure for sys_org_relationship
-- ----------------------------

CREATE TABLE `sys_org_relationship` (
`id`  int(11) NOT NULL AUTO_INCREMENT ,
`org_id`  int(11) NOT NULL ,
`phase_id`  int(11) NOT NULL ,
`schooling`  int(1) NOT NULL ,
PRIMARY KEY (`id`)
)
ENGINE=InnoDB
DEFAULT CHARACTER SET=utf8 COLLATE=utf8_general_ci
AUTO_INCREMENT=1

;


-- ----------------------------
-- Table structure for sys_org_solution
-- ----------------------------

CREATE TABLE `sys_org_solution` (
`id`  int(11) NOT NULL AUTO_INCREMENT ,
`org_id`  int(11) NULL DEFAULT NULL COMMENT '学校id' ,
`solution_id`  int(11) NULL DEFAULT NULL ,
`is_delete`  tinyint(1) NULL DEFAULT 0 COMMENT '是否删除' ,
PRIMARY KEY (`id`)
)
ENGINE=InnoDB
DEFAULT CHARACTER SET=utf8 COLLATE=utf8_general_ci
COMMENT='学校方案表'
AUTO_INCREMENT=1
;


-- ----------------------------
-- Table structure for sys_organization
-- ----------------------------

CREATE TABLE `sys_organization` (
`id`  int(11) NOT NULL AUTO_INCREMENT COMMENT '主键' ,
`code`  varchar(25) CHARACTER SET utf8 COLLATE utf8_general_ci NULL DEFAULT NULL COMMENT '机构编码' ,
`parent_id`  int(10) UNSIGNED NULL DEFAULT NULL COMMENT '父级机构' ,
