`category`  tinyint(4) NULL DEFAULT NULL COMMENT '机构类别：如学校：分直属校' ,
`viplevel`  tinyint(4) NULL DEFAULT NULL COMMENT '会员级别：0 非会员，其他为会员不同级别' ,
`lastup_dttm`  datetime NULL DEFAULT NULL ,
`lastup_id`  int(11) NULL DEFAULT NULL ,
`crt_id`  int(11) NULL DEFAULT NULL ,
`enable`  tinyint(1) NULL DEFAULT NULL ,
`crt_dttm`  datetime NULL DEFAULT NULL ,
`system_id`  tinyint(4) NULL DEFAULT NULL COMMENT 'ѧ' ,
`org_type`  int(4) NULL DEFAULT NULL ,
`english_name`  varchar(32) CHARACTER SET utf8 COLLATE utf8_general_ci NULL DEFAULT NULL COMMENT 'Ӣ' ,
`email`  varchar(32) CHARACTER SET utf8 COLLATE utf8_general_ci NULL DEFAULT NULL ,
`sch_website`  varchar(32) CHARACTER SET utf8 COLLATE utf8_general_ci NULL DEFAULT NULL COMMENT 'ѧУ' ,
`direct_area_id`  varchar(32) CHARACTER SET utf8 COLLATE utf8_general_ci NULL DEFAULT NULL COMMENT 'ֱ' ,
`dirlevel_id`  varchar(32) CHARACTER SET utf8 COLLATE utf8_general_ci NULL DEFAULT NULL COMMENT 'ֱ' ,
`trdparty_org_id`  varchar(64) CHARACTER SET utf8 COLLATE utf8_general_ci NULL DEFAULT NULL COMMENT '对接机构ID' ,
PRIMARY KEY (`id`)
)
ENGINE=InnoDB
DEFAULT CHARACTER SET=utf8 COLLATE=utf8_general_ci
AUTO_INCREMENT=1

;


