-- ----------------------------
-- Table structure for sys_resources
-- ----------------------------

CREATE TABLE `sys_resources` (
`id`  varchar(32) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL COMMENT '主键资源id' ,
