CREATE TABLE `sys_user` (
`id`  int(11) NOT NULL ,
`nickname`  varchar(32) CHARACTER SET utf8 COLLATE utf8_general_ci NULL DEFAULT NULL ,
`name`  varchar(32) CHARACTER SET utf8 COLLATE utf8_general_ci NULL DEFAULT NULL COMMENT '真实姓名' ,
`photo`  varchar(128) CHARACTER SET utf8 COLLATE utf8_general_ci NULL DEFAULT NULL COMMENT '用户头像' ,
`original_photo`  varchar(128) CHARACTER SET utf8 COLLATE utf8_general_ci NULL DEFAULT NULL COMMENT '缩略图' ,
`org_id`  int(11) NULL DEFAULT NULL COMMENT '所属机构ID' ,
`cellphone`  varchar(32) CHARACTER SET utf8 COLLATE utf8_general_ci NULL DEFAULT NULL ,
`cellphone_view`  tinyint(1) NULL DEFAULT 0 COMMENT '手机是否可见' ,
`cellphone_valid`  tinyint(1) NULL DEFAULT 0 COMMENT '手机是否验证' ,
`mail`  varchar(64) CHARACTER SET utf8 COLLATE utf8_general_ci NULL DEFAULT NULL ,
`mail_valid`  tinyint(1) NULL DEFAULT 0 COMMENT '邮箱是否验证' ,
`mail_view`  tinyint(1) NULL DEFAULT 0 COMMENT '邮箱是否可见' ,
`user_type`  tinyint(4) NULL DEFAULT 0 COMMENT '用户类别' ,
`org_name`  varchar(128) CHARACTER SET utf8 COLLATE utf8_general_ci NULL DEFAULT NULL ,
