`birthday`  datetime NULL DEFAULT NULL COMMENT '出生日期' ,
`school_age`  tinyint(4) NULL DEFAULT NULL COMMENT '教龄' ,
`profession`  varchar(32) CHARACTER SET utf8 COLLATE utf8_general_ci NULL DEFAULT NULL COMMENT '职称' ,
`honorary`  varchar(32) CHARACTER SET utf8 COLLATE utf8_general_ci NULL DEFAULT NULL COMMENT '荣誉称号' ,
`explains`  varchar(1000) CHARACTER SET utf8 COLLATE utf8_general_ci NULL DEFAULT NULL COMMENT '个人简介' ,
`remark`  varchar(200) CHARACTER SET utf8 COLLATE utf8_general_ci NULL DEFAULT NULL COMMENT '备注' ,
`crt_dttm`  datetime NULL DEFAULT NULL COMMENT '创建时间' ,
`lastup_id`  int(11) NULL DEFAULT NULL COMMENT '最后更新用户' ,
