`crt_id`  int(11) NULL DEFAULT NULL COMMENT '创建者id' ,
`app_id`  int(1) NULL DEFAULT 0 ,
`teacher_level`  varchar(20) CHARACTER SET utf8 COLLATE utf8_general_ci NULL DEFAULT '' ,
`address`  varchar(128) CHARACTER SET utf8 COLLATE utf8_general_ci NULL DEFAULT '' ,
`postcode`  varchar(8) CHARACTER SET utf8 COLLATE utf8_general_ci NULL DEFAULT '' ,
`cercode`  varchar(32) CHARACTER SET utf8 COLLATE utf8_general_ci NULL DEFAULT '' ,
`last_login`  datetime NULL DEFAULT NULL ,
PRIMARY KEY (`id`),
INDEX `org_id` (`org_id`) USING BTREE 
)
ENGINE=InnoDB
DEFAULT CHARACTER SET=utf8 COLLATE=utf8_general_ci

;

